import React, { Component } from "react";
import SongDDataService from "../services/songdata.service";
import { Link } from "react-router-dom";

export default class SongDataList extends Component {
    constructor(props) {
        super(props);
        this.onChangeSearchTitle = this.onChangeSearchTitle.bind(this);
        this.retrieveSongDatas = this.retrieveSongDatas.bind(this);
        this.refreshList = this.refreshList.bind(this);
        this.setActiveSongData = this.setActiveSongData.bind(this);
        this.removeAllSongDatas = this.removeAllSongDatas.bind(this);
        this.searchTitle = this.searchTitle.bind(this);

        this.state = {
            tutorials: [],
            currentSongData: null,
            currentIndex: -1,
            searchTitle: ""
        };
    }

    componentDidMount() {
        this.retrieveSongDatas();
    }

    onChangeSearchTitle(e) {
        const searchTitle = e.target.value;

        this.setState({
            searchTitle: searchTitle
        });
    }

    retrieveSongDatas() {
        SongDDataService.getAll()
            .then(response => {
                this.setState({
                    tutorials: response.data
                });
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });
    }

    refreshList() {
        this.retrieveSongDatas();
        this.setState({
            currentSongData: null,
            currentIndex: -1
        });
    }

    setActiveSongData(tutorial, index) {
        this.setState({
            currentSongData: tutorial,
            currentIndex: index
        });
    }

    removeAllSongDatas() {
        SongDDataService.deleteAll()
            .then(response => {
                console.log(response.data);
                this.refreshList();
            })
            .catch(e => {
                console.log(e);
            });
    }

    searchTitle() {
        this.setState({
            currentSongData: null,
            currentIndex: -1
        });

        SongDDataService.findByTitle(this.state.searchTitle)
            .then(response => {
                this.setState({
                    tutorials: response.data
                });
                console.log(response.data);
            })
            .catch(e => {
                console.log(e);
            });
    }

    render() {
        const { searchTitle, tutorials, currentSongData, currentIndex } = this.state;

        return (
            <div className="list row">
                <div className="col-md-8">
                    <div className="input-group mb-3">
                        <input
                            type="text"
                            className="form-control"
                            placeholder="Search by title"
                            value={searchTitle}
                            onChange={this.onChangeSearchTitle}
                        />
                        <div className="input-group-append">
                            <button
                                className="btn btn-outline-secondary"
                                type="button"
                                onClick={this.searchTitle}
                            >
                                Search
                            </button>
                        </div>
                    </div>
                </div>
                <div className="col-md-6">
                    <h4>SongDatas List</h4>

                    <ul className="list-group">
                        {tutorials &&
                            tutorials.map((tutorial, index) => (
                                <li
                                    className={
                                        "list-group-item " +
                                        (index === currentIndex ? "active" : "")
                                    }
                                    onClick={() => this.setActiveSongData(tutorial, index)}
                                    key={index}
                                >
                                    {tutorial.title}
                                </li>
                            ))}
                    </ul>

                    <button
                        className="m-3 btn btn-sm btn-danger"
                        onClick={this.removeAllSongDatas}
                    >
                        Remove All
                    </button>
                </div>
                <div className="col-md-6">
                    {currentSongData ? (
                        <div>
                            <h4>SongData</h4>
                            <div>
                                <label>
                                    <strong>Title:</strong>
                                </label>{" "}
                                {currentSongData.title}
                            </div>
                            <div>
                                <label>
                                    <strong>Description:</strong>
                                </label>{" "}
                                {currentSongData.description}
                            </div>
                            <div>
                                <label>
                                    <strong>Status:</strong>
                                </label>{" "}
                                {currentSongData.published ? "Published" : "Pending"}
                            </div>

                            <Link
                                to={"/tutorials/" + currentSongData.id}
                                className="badge badge-warning"
                            >
                                Edit
                            </Link>
                        </div>
                    ) : (
                        <div>
                            <br />
                            <p>Please click on a SongData...</p>
                        </div>
                    )}
                </div>
            </div>
        );
    }
}
